    % Regole:

    % prec(Game1, Game2): Game1 è considerata precedente a Game2 se il game_id di Game1 è numericamente minore di Game2
    prec(Game1, Game2) :-
        partita(Game1, _, _, _, _, _, _, _, _, _, _, _),
        partita(Game2, _, _, _, _, _, _, _, _, _, _, _),
        sub_atom(Game1, 1, _, 0, ID1),
        sub_atom(Game2, 1, _, _, ID2),
        atom_number(ID1, Num1),
        atom_number(ID2, Num2),
        Num1 < Num2.

    % not_newbie(Game): il giocatore non è più inesperto se ha giocato più di 50 partite
    not_newbie(Game) :-
        sub_atom(Game, 1, _, 0, ID),
        atom_number(ID, Num),
        Num > 50.

    % kda(Game, KDA): calcola il KDA della partita come (kills + assists) / max(1, deaths)
    kda(Game, KDA) :-
        partita(Game, K, D, A, _, _, _, _, _, _, _, _),
        KDA is (K + A) / max(1, D).

    % high_kda(Game): Game ha un KDA alto se il KDA calcolato è maggiore di 3
    high_kda(Game) :-
        kda(Game, KDA),
        KDA > 3.

    % high_kill_participation(Game): Game ha una partecipazione alle kill alta se KP > 4
    high_kill_participation(Game) :-
        partita(Game, _, _, _, KP, _, _, _, _, _, _, _),
        KP > 4.

    % high_gpm(Game): Game ha un efficienza economica alta se gold per minuto > 400
    high_gpm(Game) :-
        partita(Game, _, _, _, _, GPM, _, _, _, _, _, _),
        GPM > 400.

    % good_farm(Game): Game ha un buon farm se il numero totale di minion uccisi > 180
    good_farm(Game) :-
        partita(Game, _, _, _, _, _, CS, _, _, _, _, _),
        CS > 180.

    % high_damage(Game): Game ha un danno totale elevato se Damage > 160000
    high_damage(Game) :-
        partita(Game, _, _, _, _, _, _, Damage, _, _, _, _),
        Damage > 160000.

    % good_vision(Game): Game ha un buon vision score se Vision > 1.2
    good_vision(Game) :-
        partita(Game, _, _, _, _, _, _, _, Vision, _, _, _),
        Vision > 1.2.

    % skillful_offense(Game): Game ha precisione offensiva elevata se i colpi andati a segno > 40
    skillful_offense(Game) :-
        partita(Game, _, _, _, _, _, _, _, _, _, SHit, _),
        SHit > 40.

    % skillful_defense(Game): Game ha abilità difensiva elevata se skillshots evitati > 80
    skillful_defense(Game) :-
        partita(Game, _, _, _, _, _, _, _, _, SDodged, _, _),
        SDodged > 80.

    % astonishing(Game): Una partita è considerata Astonishing se il giocatore non è più newbie
    % e soddisfa almeno due dei criteri chiave: high KDA, high kill participation, high GPM, good farm, high damage, good vision.
    astonishing(Game) :-
        not_newbie(Game),
        findall(Criterion, (
            member(Criterion, [high_kda, high_kill_participation, high_gpm, good_farm, high_damage, good_vision]),
            Goal =.. [Criterion, Game],
            call(Goal)
        ), CriteriaMet),
        length(CriteriaMet, Count),
        Count >= 2.

    % normal(Game): Una partita è considerata Normal se il giocatore non è più newbie
    % e soddisfa almeno uno dei criteri chiave ma meno di due.
    normal(Game) :-
        not_newbie(Game),
        findall(Criterion, (
            member(Criterion, [high_kda, high_kill_participation, high_gpm, good_farm, high_damage, good_vision]),
            Goal =.. [Criterion, Game],
            call(Goal)
        ), CriteriaMet),
        length(CriteriaMet, Count),
        Count =:= 1.

    % bad(Game): Una partita è considerata Bad se il giocatore non è più newbie
    % e non soddisfa nessuno dei criteri chiave.
    bad(Game) :-
        not_newbie(Game),
        \+ high_kda(Game),
        \+ high_kill_participation(Game),
        \+ high_gpm(Game),
        \+ good_farm(Game),
        \+ high_damage(Game),
        \+ good_vision(Game).
